import React from "react";

const PorfolioProject = props => {
  return (
    <div className="row">
      {props.myPorftolioUn.map(myFolio => (
        <div
          className="card"
          style={{
            width: "28rem",
            marginTop: "20px",
            paddingRight: "10px",
            borderRadius: "10px"
          }}
          key={myFolio.id}
        >
          <img src={myFolio.myImg} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title fw-bolder"> {myFolio.mytitle} </h5>
            <p className="card-text">{myFolio.myContent}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default PorfolioProject;
